description:
* Nhà đẹp Võ Chí Công, khu phân lô của Bộ Giáo dục, cách mặt phố tầm 30m, trước nhà ô tô tránh, ngõ thông Lạc Long Quân.

* Thiết kế và thi công chắc chắn theo kiến trúc biệt thự:

- Tầng 1: gara ô tô, khách, bếp;

- tầng 2,3: tầng 2 phòng khép kín;

- Kết thúc là sân phơi, tiểu cảnh, bàn trà.

* AC quan tâm liên hệ ngay để tham quan ngôi nhà đẹp này.
